import React from 'react';
import '../css/ImageList.css';



class ImageCard extends React.Component {
    render() {
        return (
            <div>
                <img
                    alt={this.props.image.description}
                    src={this.props.image.urls.regular}
                />
            </div>
        );
    }
}

export default ImageCard;
